/* Global Styles */
* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    font-family: 'Arial', sans-serif;
}

/* Center the main container */
#mainContainer {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    max-width: 1000px;
    margin: 30px auto;
    padding: 20px;
    background: #f5f5f5;
    border-radius: 10px;
    box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
}

/* Sketch container (Grid) */
#sketchContainer {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    width: 600px;
    height: 600px;
    border: 2px solid #333;
    border-radius: 8px;
    background: white;
    margin-bottom: 20px;
    transition: all 0.3s ease-in-out;
    overflow: hidden;
}

/* Individual grid boxes */
.box {
    border: 1px solid rgba(0, 0, 0, 0.1);
    transition: background 0.2s;
}

/* Controls */
.controls {
    display: flex;
    gap: 10px;
    flex-wrap: wrap;
    justify-content: center;
    margin-bottom: 20px;
}

/* Input field */
input[type="number"], input[type="color"] {
    padding: 8px;
    border: 1px solid #ccc;
    border-radius: 5px;
    font-size: 16px;
    transition: 0.2s;
}

input[type="number"]:focus, input[type="color"]:focus {
    outline: none;
    border-color: #007BFF;
}

/* Buttons */
button {
    padding: 10px 15px;
    font-size: 16px;
    color: white;
    background: #007BFF;
    border: none;
    border-radius: 5px;
    cursor: pointer;
    transition: 0.2s;
}

button:hover {
    background: #0056b3;
}

#reset {
    background: #DC3545;
}

#reset:hover {
    background: #a71d2a;
}

