// Non-blocking delay function
bool nonBlockingDelay(unsigned long delayTime) {
    unsigned long currentTime = millis();
    if (currentTime - lastActionTime >= delayTime) {
        lastActionTime = currentTime;
        return true;
    }
    return false;
}

