def b10tob7(n):
    if n == 0:
        return '0'
    a = []
    while n != 0:
        r = n - (n // 7) * 7
        a.insert(0, str(r))
        n = (n - r) // 7
    b = ""
    for i in range(len(a)):
        b += a[i]
    return b

