private func expandAroundCenter(_ s: String, left: Int, right: Int) -> Int {
    var l = left
    var r = right
    let chars = Array(s)

    print("left: ",l,"right:", r)
    while l >= 0 && r < chars.count && chars[l] == chars[r] {
        l -= 1
        r += 1
    }

    return r - l - 1

